import Profile from "./components/home/Profile";
import './App.css';
import Navbar from "./components/navbar/Navbar";

function App() {
  return (
    <div className="bg-move"
    style={{
      backgroundImage: `url("https://d3ui957tjb5bqd.cloudfront.net/images/screenshots/products/0/8/8905/red-rocks-park-o.jpg")`,

      backgroundRepeat: "no-repeat",
      // width: "90%",
      // height: "600px",
      backgroundSize: "cover",
    }}
    >
      <Navbar />
      <div className="">
        <Profile />
      </div>
    </div>
  );
}

export default App;
